export const styles = theme => ({
    root: {
        background: `${theme.palette.success.main}`,
        borderRadius: "6px 6px 2px 6px",
        color: `${theme.palette.white.main}`,
        fontFamily: theme.font.semibold,
        fontSize: "13px",
        height: "36px",
        overflow: "hidden",
        width: "36px",
    },
    small: {
        fontSize: "10px",
        height: "24px",
        width: "24px",
    },
    label: { padding: `0 ${theme.spacing(1)}px` },
});
